    false,nt"url": null,nt"notes": "This narrative report for National Elk
    Refuge outlines Refuge accomplishments from September through December of 1948.
    The report begins by summarizing the weather conditions and wildfires during this
    period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. The public
    relations section discusses Refuge visitors. N-R forms and photographs are attached.",nt"license_title":
